import React, { Component } from 'react';
import {Link } from 'react-router-dom';

class Home extends Component {
    render() {
        return (
            <div>
                <div class="container">
                    <div class="row align-items-start">
                        <div class="Bienvenido">
                            <h1>Bienvenidos</h1>
                            <button type="button" class="btn btn-link">Link</button>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
